                "IT", "Design", "Others"
            ]);
        }


        const flag = listClass.find((l)=>{return className == l})
        console.log(flag)

    }, [props.url.query.kelas])
    return(
        <Layout activeClass={props.url.pathname}>
            <h1>Program Class {className}</h1>
        </Layout>
    )
}


export default Program;
